import React from "react";
import ReviewCard from "./ReviewCard";
import "../stylesheets/Reviews.css";

export default function Reviews() {
    return (
        <div className="reviews">
            <div className="score">
                Reviews
            </div>
            <div className="review-cards">
                <ReviewCard />
                <ReviewCard />
                <ReviewCard />
            </div>
        </div>
    )
}
